import {Link} from 'react-router-dom';
import styles from './Home.module.css';

function Home(){
    function redirect(adress){
        <Link to={`"/"${adress}`}>Entrar</Link>
    }
    return(
        <section>
            <h1>Bem vindo ao <span className={styles.title}>Cadastrador!</span></h1>
            <p>Escolha entre <span>Cadastrar-se</span>, para criar uma conta ou <span>Entrar</span>, caso j√° possua uma</p>
            <div className={styles.container}>
                <div className={styles.containerCadastrar}>
                    <div className={styles.link}><Link to="/Cadastrar">Cadastrar</Link></div>
                </div>
                <div className={styles.containerEntrar}>
                    <div className={styles.link} ></div>
                    <button onClick={redirect("Entrar")}></button>
                </div>
            </div>
        </section>
    )
}

export default Home;
